import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class InfoWindow extends Component {

  injectInfo(e, pass) {
    if (pass) {
      ReactDOM.render(
        <div className="info-window">
          <div>{this.props.loc.title}</div>
        </div>,
        document.getElementById(`${this.props.loc.title}`)
      )
    } else {
      ReactDOM.render(
        <div className="info-window-display">Error {e}</div>,
        document.getElementById(`${this.props.loc.title}`)
      )
    }
    console.log(e);
  }

  componentDidMount() {
    fetch(`https://api.foursquare.com/v2/venues/search?client_id=BITALC3HSA4PLMTBLQXFRKDYX1Y0SCCWFBMWZC2SW2CTKJFW&client_secret=ESBUR3GBTUWVOYGUWQ4BGET0A3DGI0VYQTWCS2H1RU5CPK2Wll=40.7484,-73.9857&intent=match&limit=1`, {
      method: 'GET'
    } )
    .then((response) => {
        if (response) {
          this.injectInfo(response, true);
        }
    })
    .catch((error) => {
      this.injectInfo(error, false);
    })
  }


  render() {
    return (
      //Empty div to be populated by props passed down
    // <div className="info-window">{props.title}</div>
      <div id={this.props.loc.title}>Nothing</div>
    )
  }
}


export default InfoWindow
